import React from 'react';

const OfferComponent = ({ offers }) => {
  return (
    <div>
      <h2>Offers</h2>
      <div>
        {offers.map((offer) => (
          <div key={offer.id}>
            <h3>{offer.name}</h3>
            <p>Sub2: {offer.sub2}</p>
            <p>Logo: <img src={offer.logo} alt={offer.name} /></p>
            <p>Bonuses:</p>
            <ul>
              <li>Rate: {offer.bonuses.rate}</li>
              <li>Amount: {offer.bonuses.amount}</li>
              <li>Country: {offer.bonuses.country}</li>
              <li>Free Spins: {offer.bonuses.free_spins}</li>
              <li>Welcome Bonus: {offer.bonuses.welcome_bonus}</li>
            </ul>
            <p>Link: <a href={offer.link}>{offer.link}</a></p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OfferComponent;
